import React from "react";
import { Paper, Grid } from "@material-ui/core";

function Profile() {
  return (
    <Paper>
      <Grid>
        <img
          onClick={Gotoprofile}
          className="make-small-image-clickable-neutral  iconPc"
          style={{
            position: "relative",
            objectFit: "contain",
            width: imageWidth,
            borderRadius: "200px",
            margin: "auto",
          }}
          src={profilePic}
          alt="SuperstarZ logo"
        />
      </Grid>
    </Paper>
  );
}

export default Profile;
